import java
import semmle.code.java.dataflow.Guards

int chainInstanceOfGuards(ConditionBlock cb, CastExpr ce) {
  exists(int rest | (
      if cb.getTestSuccessor(false) instanceof ConditionBlock
      then rest = chainInstanceOfGuards(cb.getTestSuccessor(false), ce)
      else rest = 0
    ) and (
      if cb.getCondition() instanceof InstanceOfExpr and cb.getTestSuccessor(true) = ce.getBasicBlock()
      then result = 1 + rest
      else result = rest
    )
  )
}

predicate mostSpecificSuperType(RefType l, RefType r, RefType c) {
  l.getAnAncestor() = c and r.getAnAncestor() = c and
  forall (RefType other | l.getAnAncestor() = other and r.getAnAncestor() = other | other = c.getASupertype())
}

//  and ensureCommonSuperType(ce, cb, ioe, cst)
//  and not exists(ConditionBlock other | cb = other.getTestSuccessor(false) and other.getTestSuccessor(true) = ce.getBasicBlock() )
predicate ensureCommonSuperType(CastExpr ce, ConditionBlock cb, InstanceOfExpr ioe, RefType cst) {
  ioe = cb.getCondition() and cb.getTestSuccessor(true) = ce.getBasicBlock() and
  if cb.getTestSuccessor(false) instanceof ConditionBlock
  then exists(RefType rt | ensureCommonSuperType(ce, cb.getTestSuccessor(false), cb.getCondition(), rt) and mostSpecificSuperType(rt, ioe.getTypeName().getType(), cst) )
  else cst = ioe.getTypeName().getType()
}

predicate isGetClassMethodAccess(MethodAccess ma) {
  ma.getMethod().getName() = "getClass" and
  ma.getMethod().getNumberOfParameters() = 0 and
  exists (TypeClass tc | ma.getMethod().getReturnType() = tc)
}

//----//

predicate isCast(CastExpr ce) {
  true = true
}

predicate isPrimCast(CastExpr ce) {
  ce.getExpr().getType() instanceof PrimitiveType
}

predicate isRefCast(CastExpr ce) {
  ce.getExpr().getType() instanceof RefType or
  ce.getExpr().getType() instanceof NullType
}

predicate isRefPrimPartition(CastExpr ce) {
  isCast(ce) implies (
    (isRefCast(ce) and not isPrimCast(ce)) or  (not isRefCast(ce) and isPrimCast(ce))
  )
}

predicate isInstanceOfGuardedCast(CastExpr ce) {
  exists (ConditionBlock cb, InstanceOfExpr ioe |
    ce.getTypeExpr().getType() = ioe.getTypeName().getType() and
    ce.getExpr().getType() = ioe.getExpr().getType() and
    ioe = cb.getCondition() and
    cb.controls(ce.getBasicBlock(), true)
  )
}

predicate isGetClassGuardedCast(CastExpr ce) {
  exists (Method m, EqualityTest eqe, MethodAccess tma, MethodAccess oma |
    isGetClassMethodAccess(tma) and isGetClassMethodAccess(oma) and not tma.hasQualifier() and
    oma.getQualifier() = m.getParameter(0).getAnAccess() and
    eqe.hasOperands(tma, oma) and
    eqe.getEnclosingCallable() = m and
    exists (ConditionBlock cb | eqe = cb.getCondition() and (
      (eqe.getOp() = " == " and cb.controls(ce.getBasicBlock(), true) ) or
      (eqe.getOp() = " != " and cb.controls(ce.getBasicBlock(), false) )
    ))
  )
}

predicate isGetClassIsArrayGuardedCast(CastExpr ce) {
  exists (ConditionBlock cb, MethodAccess iama |
    cb.getCondition() = iama and
    iama.getMethod().getName() = "isArray" and
    iama.getMethod().getNumberOfParameters() = 0 and
    iama.getQualifier().getType() instanceof TypeClass and
    cb.controls(ce.getBasicBlock(), true)
  )
}

predicate isUnionGuardedCast(CastExpr ce) {
  count(ConditionBlock cb, InstanceOfExpr ioe |
    ioe = cb.getCondition() and
    cb.getTestSuccessor(true) = ce.getBasicBlock()
  ) > 1
}

predicate isGuardedCast(CastExpr ce) {
  isInstanceOfGuardedCast(ce) or isGetClassGuardedCast(ce) or isGetClassIsArrayGuardedCast(ce) or isUnionGuardedCast(ce)
}

predicate isGuardedPartition(CastExpr ce) {
  isGuardedCast(ce) implies (
    (     isInstanceOfGuardedCast(ce) and not isGetClassGuardedCast(ce) and not isGetClassIsArrayGuardedCast(ce) and not isUnionGuardedCast(ce) ) or
    ( not isInstanceOfGuardedCast(ce) and     isGetClassGuardedCast(ce) and not isGetClassIsArrayGuardedCast(ce) and not isUnionGuardedCast(ce) ) or
    ( not isInstanceOfGuardedCast(ce) and not isGetClassGuardedCast(ce) and     isGetClassIsArrayGuardedCast(ce) and not isUnionGuardedCast(ce) ) or
    ( not isInstanceOfGuardedCast(ce) and not isGetClassGuardedCast(ce) and not isGetClassIsArrayGuardedCast(ce) and     isUnionGuardedCast(ce) )
  )
}

// https://lgtm.com/projects/g/gradle/gradle/snapshot/d68afc14b1ea214803549a55021a5e74d114b8c7/files/subprojects/internal-performance-testing/src/main/groovy/org/gradle/performance/measure/Units.java?sort=name&dir=ASC&mode=heatmap&showExcluded=false#L160
// https://lgtm.com/projects/g/apache/hadoop/snapshot/35de1916b2c1e7ef2f9c7988e818e33966b451ec/files/hadoop-common-project/hadoop-common/src/main/java/org/apache/hadoop/security/token/Token.java?sort=name&dir=ASC&mode=heatmap&showExcluded=false#L394
predicate isTypeParameterCast(CastExpr ce) {
  ce.getTypeExpr().getType() instanceof GenericType
}

// https://lgtm.com/projects/g/neo4j/neo4j/snapshot/c3b534bf0d0af2b22f7b15a6c0ce1324cc29167e/files/community/bolt/src/main/java/org/neo4j/bolt/transport/WebSocketFrameTranslator.java?sort=name&dir=ASC&mode=heatmap&showExcluded=false#L39
// https://lgtm.com/projects/g/apache/hadoop/snapshot/35de1916b2c1e7ef2f9c7988e818e33966b451ec/files/hadoop-common-project/hadoop-auth/src/main/java/org/apache/hadoop/security/authentication/util/KerberosUtil.java?sort=name&dir=ASC&mode=heatmap&showExcluded=false#L432
predicate isArgumentCheckCast(CastExpr ce) {
  exists (ConditionBlock cb, InstanceOfExpr ioe, Parameter p |
    ce.getExpr() = p.getAnAccess() and ioe.getExpr() = p.getAnAccess() and
    exists (Method d | ce.getEnclosingCallable().(Method).overrides(d)) and
    ioe = cb.getCondition() and cb.controls(ce.getBasicBlock(), true)
  )
}

// https://lgtm.com/projects/g/neo4j/neo4j/snapshot/c3b534bf0d0af2b22f7b15a6c0ce1324cc29167e/files/community/bolt/src/test/java/org/neo4j/bolt/v1/runtime/integration/SessionRule.java?#L68
predicate isClassFamilyCast(CastExpr ce) {
  exists (MethodAccess ma, RefType rt |
    ce.getExpr() = ma and
    not ma.getMethod().isStatic() and
    rt = ma.getMethod().getReturnType() and rt.isAbstract() and not rt instanceof TypeObject
  )
}

predicate isCloneCast(CastExpr ce) {
  exists (CloneMethod cm, SuperMethodAccess sma, CloneMethod cma |
    ce.getEnclosingCallable() = cm and
    ce.getExpr() = sma and
    sma.getMethod() = cma
  )
}

predicate isCovariantReturnCast(CastExpr ce) {
  exists (RefType rt, Method m, Method d, VirtualMethodAccess vma |
    ce.getType() = rt and
    ce.getEnclosingCallable() = m and m.overrides(d) and ce.getExpr() = vma  and vma.isOwnMethodAccess()
  )
}

predicate isEqualsCast(CastExpr ce) {
  exists (EqualsMethod eqm |
    ce.getEnclosingCallable() = eqm and
    ce.getExpr() = eqm.getParameter().getAnAccess() and
    ce.getTypeExpr().getType() = eqm.getDeclaringType() and
    ( isInstanceOfGuardedCast(ce) or isGetClassGuardedCast(ce) )
  )
}

predicate isExceptionForRethrowCast(CastExpr ce) {
  exists (CatchClause cc | cc.getAChild*() = ce.getEnclosingStmt() )
}

predicate isFactoryMethodCast(CastExpr ce) {
  exists (MethodAccess ma | ce.getExpr() = ma and ma.getMethod().getName() = "getLogger")
}

predicate isLookupByIdCast(CastExpr ce) {
  exists (MethodAccess ma, FieldAccess fa |
    ma = ce.getExpr() and
    not ma.getMethod().isStatic() and not ma.getMethod().isVarargs() and
    ma.getMethod().isPublic() and
    ma.getMethod().getNumberOfParameters() = 1 and
    ma.getMethod().getParameterType(0).getTypeDescriptor() = "Ljava/lang/String;" and
    ma.getMethod().getReturnType().getTypeDescriptor() = "Ljava/lang/Object;" and
    ma.getArgument(0).getType().getTypeDescriptor() = "Ljava/lang/String;" and
    ma.getArgument(0) = fa and
    fa.getField().isFinal() and fa.getField().isStatic() and //fa.getField().isPublic() and
    fa.getField().getType().getTypeDescriptor() = "Ljava/lang/String;" // Double-check
  )
}

predicate isLookupByTypeTagCast(CastExpr ce) {
  exists (SwitchStmt ss, RefType rt |
    ce.getType() = rt and exists(int n | ce.getEnclosingStmt() = ss.getStmt(n))
  )
}

predicate isMethodArgumentObjectCast(CastExpr ce) {
  exists (InstanceOfExpr ioe, Method m, Method d, Parameter p |
    ioe.getExpr() = p.getAnAccess() and ce.getExpr() = p.getAnAccess() and
    m = ce.getEnclosingCallable() and m.overrides(d) and p.getType() instanceof TypeObject
  )
}

predicate isNewInstanceCast(CastExpr ce) {
  exists (MethodAccess ma, Method m |
    ma = ce.getExpr() and m = ma.getMethod() and m.getName() = "newInstance" and
    exists (string qname | qname = m.getDeclaringType().getQualifiedName() and (
      qname = "java.lang.reflect.Array" or
      qname = "java.lang.Class<?>" or
      qname = "java.lang.reflect.Constructor<?>"
      )
    )
  )
}

predicate isObjectInCollectionCast(CastExpr ce) {
  exists (MethodAccess ma, RawType rt | ce.getExpr() = ma and ma.getQualifier().getType() = rt)
}

predicate isNullCast(CastExpr ce) {
  ce.getExpr() instanceof NullLiteral
}

predicate isReadObjectCast(CastExpr ce) {
  exists (MethodAccess ma, ReadObjectMethod rom | ce.getAChildExpr() = ma and ma.getMethod() = rom)
}

predicate isRedundantCast(CastExpr ce) {
  exists (InstanceOfExpr ioe, RefType t, RefType ct |
    t = ioe.getExpr().getType() and
    ct = ioe.getTypeName().getType() and
    ct = t.getASupertype+()
 )
}

predicate isReflectionFieldCast(CastExpr ce) {
  exists (MethodAccess ma |
    ce.getExpr() = ma and
    ma.getQualifier().getType().getTypeDescriptor() = "Ljava/lang/reflect/Field;"
  )
}

predicate isRemoveTypeParameterCast(CastExpr ce) {
  exists (RawType rt | ce.getTypeExpr().getType() = rt)
}

predicate isSearchOrFilterByTypeCast(CastExpr ce) {
  exists (LoopStmt ls | ls.getAChild*() = ce.getEnclosingStmt())
}

predicate isStashCast(CastExpr ce) {
  exists (FieldAccess fa | ce.getExpr() = fa)
}

predicate isTestingCast(CastExpr ce) {
  exists (TestMethod tm, RefType rt | ce.getEnclosingCallable() = tm and ce.getType() = rt)
}

predicate isThrowableGetCauseCast(CastExpr ce) {
  exists (MethodAccess ma |
    ce.getExpr() = ma and
    ma.getQualifier().getType().getTypeDescriptor() = "Ljava/lang/Throwable;" and
    ma.getMethod().getName() = "getCause"
  )
}

predicate isTypeParameterResolutionCast(CastExpr ce) {
  ce.getType().getTypeDescriptor() = "Ljava/lang/Class;"
}

predicate isUrlOpenConnectionCast(CastExpr ce) {
  exists (MethodAccess ma |
    ce.getExpr().getProperExpr() = ma and
    ma.getQualifier().getType().getTypeDescriptor() = "Ljava/net/URL;" and
    ma.getMethod().getName() = "openConnection"
  )
}

predicate hasPattern(CastExpr ce, string name) {
  (isCast(ce) and name = "Cast") or
  (isPrimCast(ce) and name = "PrimCast") or
  (isRefCast(ce) and name = "RefCast") or
  (isStashCast(ce) and name = "Stash") or
  (isSearchOrFilterByTypeCast(ce) and name = "SearchOrFilterByType") or
  (isRemoveTypeParameterCast(ce) and name = "RemoveTypeParameter") or
  (isReflectionFieldCast(ce) and name = "ReflectionField") or
  (isRedundantCast(ce) and name = "Redundant") or
  (isReadObjectCast(ce) and name = "ReadObject") or
  (isNullCast(ce) and name = "Null") or
  (isNewInstanceCast(ce) and name = "NewInstance") or
  (isMethodArgumentObjectCast(ce) and name = "MethodArgumentObject") or
  (isLookupByTypeTagCast(ce) and name = "LookupByTypeTag") or
  (isLookupByIdCast(ce) and name = "LookupById") or
  (isFactoryMethodCast(ce) and name = "FactoryMethod") or
  (isExceptionForRethrowCast(ce) and name = "ExceptionForRethrow") or
  (isEqualsCast(ce) and name = "Equals") or
  (isCovariantReturnCast(ce) and name = "CovariantReturn") or
  (isCloneCast(ce) and name = "Clone") or
  (isClassFamilyCast(ce) and name = "ClassFamily") or
  (isArgumentCheckCast(ce) and name = "ArgumentCheck") or
  (isTypeParameterCast(ce) and name = "TypeParameter") or
  (isUnionGuardedCast(ce) and name = "UnionGuarded") or
  (isGetClassIsArrayGuardedCast(ce) and name = "GetClassIsArrayGuarded") or
  (isGetClassGuardedCast(ce) and name = "GetClassGuarded") or
  (isInstanceOfGuardedCast(ce) and name = "InstanceOfGuarded") or
  (isObjectInCollectionCast(ce) and name = "ObjectInCollection") or
  (isTestingCast(ce) and name = "Testing") or
  (isThrowableGetCauseCast(ce) and name = "ThrowableGetCause") or
  (isTypeParameterResolutionCast(ce) and name = "TypeParameterResolution") or
  (isUrlOpenConnectionCast(ce) and name = "UrlOpenConnection")
}

from CastExpr ce, string name
where hasPattern(ce, name)
select ce, ce.getTypeExpr().getType(), ce.getExpr().getType(), name
